import './App.css';
import Navbar from './Components/Navbar/Navbar';
import Content from './Components/Content/Content';
import {BrowserRouter} from 'react-router-dom';

function App() {
  return (
      <div className="baseDiv">
        <BrowserRouter>
          <Navbar/>
          <Content/>
        </BrowserRouter>
      </div>
  );
}

export default App;
